import { Customer } from '../../Entitis.type';
import { useState, useEffect,useContext} from 'react';
import {UserContext} from '../../contexts/AppContext';
type Props = {
  token: string
};
interface User{
  customers:Customer[],
 
}
const GetAllCustomers = (props: Props) => {
   
  // //context.type
  const [customer, setCustomer] = useState<Array<Customer>>([]);
  const {U} = useContext(UserContext);
  console.log(props.token);
  
  useEffect(() => {
    fetch('http://localhost:8080/admin/customers/all', {
      method: 'GET',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).then((res) => res.json()).then((data) => {
      setCustomer(data)
      console.log(data); // log response data to console
    }).catch((error) => console.log(error));
  }, []); // add empty array to run useEffect only once on component mount

  return (
  <UserContext.Provider value={User}>
    <div className='getAllCompanys'>{
      
      customer.map((customers) => {
          return (
            <>
              <tr key={customers.id} className='coupon'></tr><br />
              <td>{customers.firstName}</td><br />
              <td>{customers.lastName}</td><br />
              <td>{customers.coupons.map((coupons) => {
                return (
                  <>
                    <td>{coupons.category}</td><br />
                    <td>{coupons.price}</td><br />
                  </>
                )
              })}</td>
            </>
          )
        })}
    </div>
</UserContext.Provider>
  )
}

export default GetAllCustomers;
